import DiaryItem from './DiaryItem';

const DiaryList = ({ diaryList, onRemove }) => {
    return (
        <div className="DiaryList">
            <h2>일기 리스트</h2>
            <h4>{diaryList.length}개의 일기가 있습니다.</h4>
            <div>
                {diaryList.map((it) => (
                    <DiaryItem key={it.id} {...it} onRemove={onRemove} /> //it 객체의 모든 데이터를 전달
                    // <div key={it.id} >
