                    //     <div>일기 : {it.content}</div>
                    //     <div>감정 : {it.emotion}</div>
                    //     <div>작성 시간 : {it.creater_date}</div>
                    // </div>
                ))}
            </div>
        </div >
    );
};

DiaryList.defaultProps = { //undefined일때의 error해결 
    diaryList: [],
};

export default DiaryList;
